        return (
            <View style={styles.overlayer}>
                <Text style={{color:'#fff', 'fontSize':'3rem'}}>
                <ActivityIndicator size="large" color="#00ff00"/>
                </Text>
            </View>
        );
    }
}

export default Overlay;

const styles = StyleSheet.create({
    overlayer: {
      flex: 1,
      position:'absolute', 
      zIndex:80,
      fontWeight: 'bold',
      backgroundColor: 'rgba(152, 152, 152, 0.9)',
      alignItems: 'center',
